import React from 'react'
import {BroswerRouter as Router, Link } from 'react-router-dom'

const TopLink = props => {

    return (
        <React.Fragment>
            <div className="topnav nav-item m-2">
                <Link className="font-weight-light" to={props.path} style={{ color: "gray", fontFamily: "#dbdbdb"}}>{props.name}</Link>
            </div>
        </React.Fragment>

    );
}

export default TopLink
